const skillCategories = [
        {
            title: "Frontend Development",
            icon: <img width="48" height="48" src="https://img.icons8.com/external-flaticons-lineal-flat-icons/48/external-front-end-computer-programming-flaticons-lineal-flat-icons.png" alt="external-front-end-computer-programming-flaticons-lineal-flat-icons"/>,
            skills: [
                {icon: <FaReact/>, name: "React.js"},
                {icon: <FaHtml5/>, name: "HTML"},
                {icon: <FaCss3/>, name: "CSS"},
                {icon: <FaJsSquare/>, name: "JavaScript"}

            ],
        },
        {
            title: "Backend Development",
            icon: <img width="48" height="48" src="https://img.icons8.com/color/48/backend-development--v1.png" alt="backend-development--v1"/>,
            skills: [
                {icon: <FaNodeJs/>, name: "Node.js"},
                {icon: <SiExpress/>, name: "Express.js"},
                {icon: <FaPython/>, name: "Python"},
                {icon: <FaJava/>, name: "Java"},
                {icon: <SiC/>, name: "C"},
                {icon: <SiPostgresql/>, name: "PostgreSQL"},
                {icon: <FaDatabase/>, name: "SQL"},
                {icon: <img width="20" height="20" src="https://img.icons8.com/ios/25/api-settings.png" alt="api-settings"/>, name: "REST APIs"}
            ],
        },
        {
            title: "Tools",
            icon: <img width="48" height="48" src="https://img.icons8.com/color/48/administrative-tools.png" alt="administrative-tools"/>,
            skills: [
                {icon: <FaGitAlt/>, name: "Git"},
                {icon: <FaGithub/>, name: "GitHub"},
                {icon: <img width="20" height="20" src="https://img.icons8.com/color/32/visual-studio-code-2019.png" alt="visual-studio-code-2019"/>, name: "VS Code"},
                {icon: <SiOracle/>, name: "Oracle VirtualBox"},
                {icon: <SiPostman/>, name: "Postman"}
            ],
        },

        {
            title: "Soft Skills",
            icon: <img width="48" height="48" src="https://img.icons8.com/external-flaticons-lineal-color-flat-icons/48/external-soft-skills-job-search-flaticons-lineal-color-flat-icons-2.png" alt="external-soft-skills-job-search-flaticons-lineal-color-flat-icons-2"/>,
            skills: [
                {icon: <span>üí°</span>, name: "Problem Solving"},
                {icon: <span>ü§ù</span>, name: "Teamwork"},
                {icon: <span>üó£Ô∏è</span>, name: "Communication"},
                {icon: <span>üîÑ</span>, name: "Adaptability"},
                {icon: <span>‚è±Ô∏è</span>, name: "Time Management"},
                {icon: <span>ü§î</span>, name: "Critical Thinking"},
                {icon: <span>üßê</span>, name: "Attention to Detail"},
            ],
        },
    ];

 function Skills() {
    return (
        <section id="skills" className="skills-section">
            <div className="section-container">
                <h2 className="section-title">Skills</h2>
                <div className="skills-grid">
                    {skillCategories.map((category, index) => (
                        <div key={index} className="skill-card">
                            <div className="skill-header">
                                <div className="skill-icon">{category.icon}</div>
                                <h3 className="skill-title">{category.title}</h3>
                            </div>
                            <div className="skill-list">
                                {category.skills.map((skill, skillIndex) => (
                                    <div key={skillIndex} className="skill-item">
                                        <span className="skill-icon">{skill.icon}</span>
                                        <span className="skill-name">{skill.name}</span>
                                        </div>
                                    ))}
                                </div>
                            </div>
                            ))}
                        </div>
                      </div>
                </section>
    );
}

export default Skills;
